import React from 'react';

export function Navigation({ selectedRoute }) {
    return (
        <nav>
            <ul>
                <li className={selectedRoute === 'about' ? 'selected' : ''}>About Me</li>
                <li className={selectedRoute === 'portfolio' ? 'selected' : ''}>Portfolio</li>
                <li className={selectedRoute === 'contact' ? 'selected' : ''}>Contact</li>
                <li className={selectedRoute === 'resume' ? 'selected' : ''}>Resume</li>
            </ul>
        </nav>
    );
}
